import "./App.css";
import NewTodo from "./components/NewTodo";
import Todos from "./components/Todos";
import Todo from "./models/todo";

function App() {
  const todos = [new Todo(1, "Learn React"), new Todo(2, "Learn Typescript")];
  return (
    <>
      <NewTodo />
      <Todos items={todos} />;
    </>
  );
}

export default App;
